import styled from "styled-components";

const Button = styled.button`
  width: 180px;
  background-color: var(--blue);
  color: var(--white);
  font-weight: 800;
  border: none;
  padding: 6px;
  font-size: 15px;

  &:hover {
    border: solid 0.5px var(--white);
  }
`;

function EditButton(props) {
  return (
    <Button>
      <p>{props.name}</p>
      <p>{props.position}</p>
    </Button>
  );
}

export default EditButton;
